INSERT INTO `projektcategory_lang` VALUES (1,1,1,'Baza','','baza','','',''),(2,1,1,'Strona gwna','','strona-glowna','','',''),(22,1,1,'Plakaty','W tym miejscu znajdziesz pen ofert stylowych plakatw i grafik! Mamy szeroki katalog plakatw pasujcych do wikszoci domw i stylw wystroju wntrz. Cigle udoskonalamy nasz ofert, dodajc do niej najpopularniejsze, a take ekskluzywne wzory plakatw. Dziki temu zawsze znajdziesz u nas co dla siebie. Odwie wygld swoich cian i ozdb je modnymi plakatami Desenio!','plakaty','Plakaty','','Stylowe plakaty, grafiki i obrazy do kupienia online. Jestemy sklepem internetowym z nowoczesnymi i przystpnymi cenowo plakatami online. U nas zawsze znajdziesz najnowsze trendy i plakaty odznaczajce si ponadczasowym designem.'),(25,1,1,'Plakaty z napisami','W kategorii Plakaty z napisami znajdziesz midzy innymi pikne, skaniajce do mylenia cytaty i zote myli z przymrueniem oka. Plakaty z napisami wietnie komponuj si z fotografi i grafik, tworzc galerie cienne, i pasuj do wikszoci pomieszcze oraz stylw wystroju wntrz.','plakaty-z-napisami','Plakaty z napisami','','Plakaty z napisami, cytatami, zotymi mylami i przesaniem. Udekoruj wntrza swojego domu za pomoc stylowego plakatu z tekstem. W naszej ofercie znajdziesz szykowne plakaty z napisami, literami, piknymi cytatami i wzorami graficznymi oraz zotymi myla'),(26,1,1,'Czarno-biae','Czer i biel s zawsze na topie! Dziki czarno-biaym plakatom na cianie mona swobodnie zmienia i dodawa kolory do wasnych wntrz. Mamy w ofercie wiele czarno-biaych plakatw we wszystkich kategoriach, od piknych fotografii po ilustracje graficzne i czarno-biae motywy ze wiata natury.','czarno-biale-plakaty','Czarno-biae','','Czarno-biae plakaty i obrazy online. U nas znajdziesz duy wybr czarno-biaych obrazw z grafikami, tekstem, ilustracjami oraz wzorami graficznymi. Wiele stylowo wygldajcych plakatw i obrazw pasuje do wystroju wntrz w czarno-biaej tonacji. Mamy r'),(29,1,1,'Natura i krajobrazy','Odkryj dostpne u nas plakaty z motywami przedstawiajcymi natur w wielu rnych stylach, zarwno w kolorze, jak i czarno-biaej tonacji. ciany ozdobione zdjciami z przyrod wprowadzaj do pomieszczenia spokj i harmoni. Udekoruj ciany motywami z wzburzonym morzem, bujnym lasem lub widokami z grskich szczytw. Nasza szeroka oferta pasuje do wielu stylw wystroju wntrz.','natura-i-krajobrazy','Natura i krajobrazy','','Obrazy z motywami przyrodniczymi, fotografie przyrodnicze i pikne obrazy inspirowane natur. Wybierz co dla siebie spord piknych fotografii przedstawiajcych morze i pla, zielone lasy, urokliwe jeziora i zapierajce dech w piersiach zdjcia nieba.'),(48,1,1,'Ramki','Wykorzystaj nasze wysokiej jakoci ramki do plakatw i zdj i stwrz kompletn galeri na cianie. Oferujemy eleganckie ramki do zdj w kolorze czarnym, biaym i kolorze dbu, a take ramki metalowe w kolorze zotym, srebrnym i miedzianym. Ramki s dostpne w omiu rozmiarach, od maych ramek do zdj o wymiarach 13 x 18 cm, po due ramki do plakatw o wymiarach 70 x 100 cm.','ramki','Ramki','','Kupuj ramki online, na stronie internetowej Desenio! Oferujemy ramki w rnym stylu irnych rozmiarach. Pasuj do wszystkich naszych plakatw. Kup ramk online, na stronie Desenio  niskie ceny i wysoka jako.'),(140,1,1,'Czarne drewniane ramki','Wysokiej jakoci czarne drewniane ramki mona z atwoci otworzy od tyu i woy w nie plakat. Maj elegancki, smuky profil i pasko przylegaj do ciany. Ozdb swoj cian z obrazami, czc te ramki z naszymi czarnymi, metalowymi klipsami.','czarne-drewniane-ramki','Czarne drewniane ramki','','Kup czarne ramki do swoich plakatw. Na stronie internetowej Desenio znajdziesz nasze stylowe czarne, drewniane ramki dostpne wrnych rozmiarach i w wietnych cenach.'),(141,1,1,'Biae drewniane ramki','Wysokiej jakoci biae drewniane ramki mona z atwoci otworzy od tyu i woy w nie plakat. Maj elegancki, smuky profil i pasko przylegaj do ciany. Biae ramki mona szykownie poczy z ramkami w kolorze dbu, nadajc cianie z obrazami stylowego, skandynawskiego charakteru.','biale-drewniane-ramki','Biae drewniane ramki','','Kupuj biae ramki online w Desenio. W naszym sklepie internetowym znajdziesz stylowe, drewniane ramki do plakatw i zdj. Dobra jako i wspaniae ceny, zamawiaj online.'),(143,1,1,'Dbowe ramki','Wysokiej jakoci ramki z surowego dbu mona z atwoci otworzy od tyu i w prosty sposb umieci wnich plakat. Maj elegancki, smuky profil i pasko przylegaj do ciany. Na cianie z obrazami ramki dbowe mona poczy znaszymi zawieszkami do plakatw i dbowymi klipsami Moebe, tworzc eleganckie zestawienie.','debowe-ramki','Dbowe ramki','','Dbowe ramki. Oferujemy szeroki wybr wysokiej jakoci niedrogich, dbowych ramek w rnych rozmiarach i kolorach. Zamw na stronie internetowej Desenio.'),(144,1,1,'Zote ramki','Wysokiej jakoci zote ramki mona zatwoci otworzy od tyu i woy wnie plakat. Maj elegancki, smuky profil i pasko przylegaj do ciany. Zote ramki doskonale si zaprezentuj na cianie zobrazami w poczeniu z naszymi zotymi klipsami do plakatw.','zlote-ramki','Zote ramki','','Kupuj online stylowe i niedrogie zote ramki. Oferujemy zote ramki w 8 rnych rozmiarach. Zamawiaj online ramki i plakaty zszybk dostaw.'),(145,1,1,'Miedziane ramki','Oyw swoje plakaty dziki naszym wysokiej jakoci miedzianym ramkom o eleganckim, nowoczesnym wygldzie. Maj elegancki, smuky profil i pasko przylegaj do ciany.','miedziane-ramki','Miedziane ramki','','Kupuj stylowe miedziane ramki online. Oferujemy niedrogie miedziane ramki do plakatw i zdj wrnych rozmiarach  z atwoci i bezpiecznie kupisz je w Desenio.'),(226,1,1,'Kalendarze na 2021 rok','Udekoruj wntrze za pomoc plakatu, ktry jest i stylowy, i praktyczny  kalendarz cienny na 2021 rok! Udekoruj swoje ciany za pomoc stylowego plakatu przedstawiajcego kalendarz, nadajcego si zarwno do biura, jak i do kuchni.','kalendarze','Kalendarze na 2021 rok','','Kup kalendarz cienny na 2021 rok online w Desenio. Stylowe kalendarze cienne w formie plakatw do zawieszenia w domu. Dopilnuj, eby wystrj Twoich wntrz by cigle na czasie i co roku wieszaj nowy kalendarz! Kalendarz w formie plakatu'),(424,1,1,'Lasy','Poznaj nasz szerok gam obrazw z lenymi krajobrazami w rnych stylach i wybierz reprodukcj, ktra podoba Ci si najbardziej. Dziki zdjciom przedstawiajcym leny krajobraz w Twoim domu zapanuje spokj. Wszystkie nasze reprodukcje z tej kolekcji mona atwo czy w zestawy w barwach ziemi.','lasy','Lasy','','Kup plakaty z krajobrazem lenym. Nasze plakaty przedstawiajce krajobraz las stworz spokojn i relaksujc atmosfer. Kupuj online w Desenio.pl'),(427,1,1,'Morza i oceany','Gboki odcie bkitu nigdy nie prezentowa si lepiej! W kategorii zdj morskich pejzay znajduj si reprodukcje z motywami jezior i oceanu w rnych stylach, odpowiadajce rnym gustom. Przegldaj reprodukcje z naszej kolekcji zdj z motywami morskich pejzay i znajd takie, ktre podobaj Ci si najbardziej. Moesz dobra do nich odpowiednie ramki i stworzy cian z obrazami.','morza-i-oceany','Morza i oceany','','Kupuj plakaty przedstawiajce pejza morski. Odkryj plakaty z relaksujcymi zdjciami wody i miejscami jak ze snw. Kupuj online w Desenio.pl'),(430,1,1,'Krajobrazy','Wrd plakatw z krajobrazami znajduj si reprodukcje przedstawiajce wszystkie najpikniejsze miejsca na Ziemi. Poznaj nasz szerok ofert reprodukcji i wybierz plakaty z krajobrazami, ktre najbardziej przypadn Ci do gustu  a nastpnie pocz je na wyjtkowej cianie z obrazami. Nasza planeta to niezwykle pikne miejsce  i to pikno chcemy uhonorowa na plakatach z krajobrazami.','krajobrazy','Krajobrazy','','Odkryj nasze plakaty z krajobrazami online. Kupuj plakaty ze zdjciami piknych krajobrazw i widokw z caego wiata w Desenio.pl'),(436,1,1,'Gry','Rzu wszystko i ruszaj w gry! W naszej szerokiej ofercie plakatw z grami kady znajdzie co dla siebie: reprodukcje w rnych stylach i kolorach oraz czarno-biae. Sprawd, jakie plakaty oferujemy i wybierz produkt, ktry najlepiej bdzie pasowa do wystroju Twojego domu.','gory','Gry','','Odkryj nasz kategori gry. Kup plakaty z motywami, zdjciami i wzorami przedstawiajcymi gry i szczyty grskie w Desenio.pl'),(448,1,1,'Niebo','Ruszaj ku niebu! Zdjcia przedstawiajce niebo nigdy nie wyjd z mody. W naszej ofercie mamy zdjcia nieba w rnych stylach i kolorach  na pewno znajdziesz co dla siebie. Wybierz reprodukcje w ywych kolorach, barwach pastelowych lub czerni i bieli, ktre bd pasowa do Twojego domu.','niebo','Niebo','','Kupuj zdjcia nieba i plakaty. Plakaty czarno-biae, w ywych kolorach i pastelowych odcieniach. Kup teraz w Desenio.pl'),(451,1,1,'Plakaty z cytatami','Wyra siebie dziki obrazom z cytatami. W tej kategorii zebralimy wszystkie nasze obrazy z tekstem i cytatami. Znajdziesz tu obrazy z rnymi cytatami: miesznymi, inspirujcymi i takimi, ktre codziennie bd Ci przypomina o tym, co najwaniejsze. S one dostpne, midzy innymi w wersji czarno-biaej, kolorowej i z ilustracjami graficznymi. Wybierz swj ulubiony plakat i powie go na ulubionej cianie w domu.','plakaty-z-cytatami','Plakaty z cytatami','','Odkryj nasz kategori Obrazy z cytatami. Plakaty z humorystycznymi, inspirujcymi cytatami i wiele innych! Kup teraz w Desenio.pl'),(454,1,1,'Litery','ciana dekoracyjna z plakatami typograficznymi to wyjtkowy element wystroju wntrza. W naszej ofercie znajdziesz sztuk z literami w rnych kolorach i stylach  plakaty ze wszystkimi literami alfabetu. Mamy dla Ciebie doskonae produkty zarwno do pokoju dziecicego, jak i salonu.','litery','Litery','','Kup sztuk z literami online! Oferujemy plakaty z literami alfabetu w wielu rnych stylach. Kup ju dzi w Desenio.pl'),(460,1,1,'Motywacyjne','Plakaty i reprodukcje motywacyjne nigdy nie wyjd z mody. W tej kategorii zebralimy nasze najlepsze propozycje. Poznaj nasz szerok ofert plakatw motywacyjnych i znajd takie, ktre najbardziej przypadn Ci do gustu. Plakat motywacyjny bdzie codziennie przypomina Ci o tym, co jest najwaniejsze i nie pozwoli Ci podda si stresowi.','motywacyjne','Motywacyjne','','Kup plakaty motywacyjne online. Odkryj ca nasz kolekcj motywacyjnych, inspirujcych i dodajcych pewnoci siebie plakatw! Kup w Desenio.pl'),(463,1,1,'Typografia','Plakaty typograficzne pasuj do wszystkich wntrz. W tej kategorii znajdziesz plakaty typograficzne w wersji czarno-biaej i kolorowej oraz w rnych stylach i z rn czcionk. atwo wic wybierzesz taki, ktry najlepiej bdzie pasowa do Twojego domu. W naszej szerokiej ofercie kady znajdzie co dla siebie. Plakaty typograficzne wietnie sprawdz si jako osobisty akcent na cianie z obrazami.','typografia-2','Typografia','','Kup plakaty typograficzne online! Odkryj nasze plakaty typograficzne w rnych stylach i kolorach. Kup teraz w Desenio.pl'),(469,1,1,'Humor','Gwarantujemy, e przegldajc produkty w tej kategorii nie powstrzymasz si od miechu. mieszne plakaty doskonale sprawdz si jako osobisty akcent na cianie z obrazami. Kady potrzebuje w swoim domu plakatu, dziki ktremu umiechnie si za kadym razem, kiedy bdzie obok niego przechodzi. Wicej umiechu! Wicej radoci!','humor','Humor','','Kupuj mieszne plakaty online. Odkryj mieszne plakaty z uroczymi cytatami i wzorami. Kup swoje ulubione plakaty ju teraz w Desenio.pl'),(1070,1,1,'Holiday Collection','Dziki naszej nowej kolekcji witecznej Holiday Collection zdobdziesz wszystko, czego potrzebujesz, aby przygotowa dom na nadchodzcy sezon witeczny! Gdy zima i sezon witeczny pukaj do drzwi, plakaty witeczne z naszej kolekcji zimowej Holiday Collection przygotuj ciany Twojego domu na nadejcie wit. Znajd swoje ulubione plakaty witeczne i zapro je do domu na czas przed witami!','holiday-collection','Holiday Collection','','witeczne plakaty artystyczne Desenio  Udekoruj swj dom plakatami i reprodukcjami z naszej najnowszej kolekcji witeczno-zimowej Holiday Collection. Seria plakatw inspirowanych zim, Boym Narodzeniem i sezonem witecznym. Kupuj na stronie Desenio.p'),(2000,1,1,'Bestsellery','Tutaj znajdziesz nasze najpopularniejsze plakaty i grafiki. Wrd naszych bestsellerw znajdziesz rne ponadczasowe motywy i najnowsze trendy znajdziesz tu co do kadego stylu wystroju wntrz! Podkrel wygld swojego domu za pomoc najbardziej stylowych plakatw Desenio.','bestsellery','Bestsellery','','Witamy wrd najpopularniejszych plakatw w Desenio! W tym miejscu zebralimy nasze najlepiej sprzedajce si plakaty, czyli najpopularniejsze obrazy w rnych stylach i rozmiarach. Plakat to prosty sposb na odnowienie i odwieenie wygldu wntrz za nis'),(2001,1,1,'Nowoci','Desenio stawia na klasyczne, jak i najnowsze trendy. Wanie dlatego zawsze oferujemy nowe wzory plakatw i obrazw. Regularnie publikujemy nowe kolekcje stworzone przez znanych fotografw, artystw i nasz wasny zesp kreatywny. Dziki temu moesz zmienia wygld swojego domu w zalenoci od potrzeb i pr roku.','nowosci','Nowoci','','Odkryj najwiesze nowoci i zainspiruj si nimi! W Desenio zawsze znajdziesz plakaty i obrazy pasujce do najnowszych trendw w aranacji wntrz. Nieustannie aktualizujemy nasz ofert, poszerzajc j o nowe motywy wykonane rnymi technikami i stylami,');
