INSERT INTO `projektcms_lang` VALUES (1,1,1,'Dostawa','','Nasze warunki i postanowienia dostawy','conditions, delivery, delay, shipment, pack','<h2>Transport i zwroty</h2>\n<h3>Transport twojej paczki</h3>\n<p>Paczki s zazwyczaj dostarczane w cigu 5-6 dni roboczych.</p>\n<p><img src=\"https://localhost/prestashop/img/cms/123830729_387375845784535_7272286204864276554_n.png\" alt=\"\" width=\"61\" height=\"39\" /></p>\n<h3>Zwroty</h3>\n<p>Towar moe zosta zwrcony w przecigu 6 tygodni od daty nadania.</p>\n<p><img src=\"https://localhost/prestashop/img/cms/123589257_421183599272061_6627939429886690045_n.png\" alt=\"\" width=\"42\" height=\"46\" /></p>','dostawa'),(2,1,1,'Nota prawna','','Nota prawna','notice, legal, credits','<h2>Prawo</h2>\n<h3>Uznanie</h3>\n<p>Koncept i produkcja:</p>\n<p>Ta strona zostaa utworzona dziki wolnemu oprogramowaniu <a href=\"http://www.prestashop.com\">PrestaShop</a>.</p>','nota-prawna'),(4,1,1,'O nas','','Dowiedz si wicej o nas','about us, informations','<h2>O nas</h2>\n<p>W Desenio pasjonujemy si wystrojem wntrz, a szczeglnie stylem skandynawskim. Nasz pomys na biznes jest prosty: stworzenie stylowych dekoracji na ciany powinno by osigalne dla kadego. W Desenio znajdziesz najszersz gam skandynawskich plakatw oraz ramek, zawieszek, klipsw i pek na obrazy. Czsto dodajemy do naszego asortymentu nowoci, aby poda za najnowszymi trendami stylw wystroju wntrz i designu skandynawskiego. W ofercie mamy artykuy dekoracyjne, wrd ktrych znajdzie si co do kadego pomieszczenia i kadego stylu wystroju.</p>\n<p><img src=\"https://localhost/prestashop/img/cms/101293493_2709696849316241_6351657319637450752_n.jpg\" alt=\"101293493_2709696849316241_6351657319637450752_n.jpg\" width=\"800\" height=\"534\" /></p>','o-nas'),(5,1,1,'Bezpieczna patno','','Nasze sposoby bezpiecznej patnoci','secure payment, ssl, visa, mastercard, paypal','<h2>Bezpieczna patno</h2>\n<h3>W naszym sklepie dokonasz bezpiecznych patnoci z uyciem szyfrowania danych za pomoc certyfikatu SSL.</h3>\n<p>Zamawiajc towar z dostaw do domu, moecie Pastwo zapaci za zamwiony towar gotwk przy odbiorze lub wybra inn form patnoci: patno kart Visa/MasterCards lub PayPal.</p>\n<h3><img src=\"https://localhost/prestashop/img/cms/123812049_807926649957944_8885427816136407918_n.png\" alt=\"\" width=\"67\" height=\"48\" /></h3>\n<p></p>','bezpieczna-platnosc');
