INSERT INTO `projektinfo_lang` VALUES (1,1,1,'<h2 style=\"text-align:center;\">MODNE I STYLOWE OBRAZY DO KADEGO DOMU I KADEGO POKOJU</h2>\n<p style=\"text-align:center;\">Sztuka powinna by dostpna dla kadego!<br />Mamy w ofercie tysice rnych obrazw z mnstwem rnorodnych motyww, dlatego mamy nadziej, e znajdziesz wrd nich obrazy idealnie pasujce do Twojego domu. Desenio chce by dla Ciebie rdem inspiracji w zakresie wystroju wntrz i wzornictwa, niezalenie od tego, czy potrzebujesz pomocy przy dekoracji sypialni, niewielkiego przedpokoju, gabinetu czy te caego domu!</p>\n<p></p>');
