INSERT INTO `projektproduct_lang` VALUES (1,1,1,'Graficzna ilustracja przedstawiajca urawia w kolorach biaym i zotym (bez pozacanej folii) leccego nad wysok traw oraz gry w tle. Ten pikny plakat nada odpowiedni kolor wntrzu i odwiey Twj dom.','Grafika z urawiem - Graficzna ilustracja przedstawiajca urawia w kolorach biaym i zotym leccego nad wysok traw i grskim krajobrazem','elegant-flight-plakat','Elegant Flight Plakat  - Graficzna ilustracja przedstawiajca urawia w kolorach biaym i zotym leccego nad wysok traw i grskim krajobrazem - Desenio.pl','elegant, flight, plakat, grafika, z, urawiem, desenio.pl','Elegant Flight Plakat','Elegant Flight Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(2,1,1,'Ilustrao grfica de duas baleias com padres, a nadar no oceano, com um c a branco e dourado de fundo. Arte grfica  um must em qualquer casa, e que adiciona cor e um toque moderno!','Grafika z wielorybami - Graficzna ilustracja w kolorze niebieskim przedstawiajca dwa wieloryby w wodzie','bond-ii-plakat','Bond II Plakat  - Graficzna ilustracja w kolorze niebieskim przedstawiajca dwa wieloryby w wodzie - Desenio.pl','bond, ii, plakat, grafika, z, wielorybami, desenio.pl','Bond II Plakat','Bond II Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(3,1,1,'Graficzna ilustracja przedstawiajca grski krajobraz w kolorach niebieskim, biaym i zotym (bez pozacanej folii) oraz czerwony ksiyc za gr, ktra odbija si w lustrze jeziora. Sztuka graficzna z kolorowymi detalami doskonale nadaje si do salonu, w ktrym prace artystyczne maj stanowi gwny element!','Grafika z odbiciem gry w wodzie - Graficzna ilustracja przedstawiajca grski krajobraz i ksiyc odbijajce si w lustrze jeziora','winters-day-plakat','Winters Day Plakat  - Graficzna ilustracja przedstawiajca grski krajobraz i ksiyc odbijajce si w lustrze jeziora - Desenio.pl','winters, day, plakat, grafika, z, odbiciem, gry, w, wodzie, desenio.pl','Winters Day Plakat','Winters Day Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(4,1,1,'Grafika artystyczna z ciemnotym socem za czarnym drzewem na beowym tle. Ekspresyjna, cho stylowa reprodukcja odpowiednia do kadego pomieszczenia. Przetarte kolory nadaj temu obrazowi niepowtarzalny wygld, dziki czemu wszystko jest jeszcze bardziej interesujcy!','Grafika przedstawiajca wschd soca  Ilustracja graficzna z czarnym drzewem na pierwszym planie i ciemnotym socem na beowym tle','winter-morning-plakat','Winter Morning Plakat   Ilustracja graficzna z czarnym drzewem na pierwszym planie i ciemnotym socem na beowym tle - Desenio.pl','winter, morning, plakat, grafika, przedstawiajca, wschd, soca, desenio.pl','Winter Morning Plakat','Winter Morning Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(5,1,1,'Akwarela z dwoma osobami, z ktrych jedna cauje drug w policzek, w czarnym kolorze, na biaym tle. Ten sodki motyw jest idealny dla kochajcej si pary! Stwrz ciepy i kochajcy dom wypeniony sztuk i wybierz obrazy, ktre pokazuj, co do siebie czujecie. Znajd wicej obrazw w kategorii Ilustracje!','Akwarelowa para  Czarno-biaa akwarelowa ilustracja kobiety caujcej mczyzn w policzek','watercolor-kiss-plakat','Watercolor Kiss Plakat   Czarno-biaa akwarelowa ilustracja kobiety caujcej mczyzn w policzek - Desenio.pl','watercolor, kiss, plakat, akwarelowa, para, desenio.pl','Watercolor Kiss Plakat','Watercolor Kiss Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(6,1,1,'Grafika geometryczna z dwiema twarzami zbliajcymi si do pocaunku, w czarnym kolorze, na biaym tle. Jeli lubisz na minimalistyczny styl, ten abstrakcyjny obraz moe si okaza po prostu idealnym wyborem! Wraz z innymi ilustracjami lub grafikami ze wiata mody moesz stworzy wymarzon cian z obrazami.','Grafiki geometryczne z twarzami  Czarno-biaa grafika geometryczna z dwiema twarzami zbliajcymi si do pocaunku','almost-kiss-plakat','Almost Kiss Plakat   Czarno-biaa grafika geometryczna z dwiema twarzami zbliajcymi si do pocaunku - Desenio.pl','almost, kiss, plakat, grafiki, geometryczne, z, twarzami, desenio.pl','Almost Kiss Plakat','Almost Kiss Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(7,1,1,'Abstrakcyjna ilustracja w stylu grafik geometrycznych z dwiema caujcymi si osobami w ucisku, narysowana w czarnym kolorze na beowym tle. Grafiki geometryczne zostaj z nami na dobre, a wraz z obrazem Abstract Figures No1 lub Abstract Figures No3 stworzysz doskona kompozycj!','Grafika geometryczna z pocaunkiem  Abstrakcyjna ilustracja z dwiema osobami narysowanymi w stylu grafik geometrycznych, caujcymi si w objciach','abstract-figures-no2-plakat','Abstract Figures No2 Plakat   Abstrakcyjna ilustracja z dwiema osobami narysowanymi w stylu grafik geometrycznych, caujcymi si w objciach - Desenio.pl','abstract, figures, no2, plakat, grafika, geometryczna, z, pocaunkiem, desenio.pl','Abstract Figures No2 Plakat','Abstract Figures No2 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(8,1,1,'Abstrakcyjna grafika geometryczna z sylwetk ludzk w kolorze czarnym na beowym tle, z tekstem u gry i u dou. Jeli chcesz, eby Twj dom by cigle modny, grafiki geometryczne to podstawa! Dopasuj ten obraz do motywu Abstract Figures No2 albo Abstract Figures No3, aby uzyska idealnie dobran par.','Grafika geometryczna z sylwetk ludzk  Grafika geometryczna z abstrakcyjn sylwetk ludzk, narysowana w czarnym kolorze na beowym tle','abstract-figures-no1-plakat','Abstract Figures No1 Plakat   Grafika geometryczna z abstrakcyjn sylwetk ludzk, narysowana w czarnym kolorze na beowym tle - Desenio.pl','abstract, figures, no1, plakat, grafika, geometryczna, z, sylwetk, ludzk, desenio.pl','Abstract Figures No1 Plakat','Abstract Figures No1 Plakat','W Magazynie.','Brak w magazynie','3-7','3-7'),(9,1,1,'Ilustracja z grafik geometryczn przedstawiajca abstrakcyjn kobiec sylwetk w czarnym kolorze na jasnoszarym tle. Ten minimalistyczny, rcznie rysowany motyw dobrze si sprawdza w wikszoci domw. Idealnie nadaje si do powieszenia na przykad w salonie.','Grafika geometryczna Peytil Rysu